import Note from "./Note"

const notes = ({notes, counter}) => {
  console.log(counter)

    return (
      <>
        {counter % 16 === 0 ?
            notes.map((note) => (
              <div className={counter}>
                 {/* <p>{counter}</p> */}
                 <p>test</p>
                <Note note={note} counter={counter} />
              </div>
            ))
        : notes.map((note) => (
          <>
            <p>{counter}</p>
            <Note note={note} counter={counter}/>
          </>
          ))
        }
      </>
    )
}

export default notes
